import React from 'react';
import './carte.css';

function Card(props) {
  return (
    <div className="cartecredit">
      <p>Inter the instruction</p>
     <div className="infos">
         <h1>{props.infos.name} </h1>
         <h1>{props.infos.RIB} </h1>
         <h1>{props.infos.date} </h1>

         </div>
    </div>
  );
}

export default Card;
